1th/reading_note_2.html.body:
2장 알아두어야 할 자바스크립트 🚀
2.1 ES2015+
2.1.1 const, let
const, let : 이전 var와 스코프 종류가 다름. var는 함수 스코프를 가지므로 블록과 관계없이 접근할 수 있지만, const와 let은 블록 스코프라 블록 밖에서는 변수에 접근할 수 없다.
블록의 범위는 if, while, for, function 등에서 볼 수 있는 중괄호. 
블록 스코프를 사용함으로서 호이스팅 문제 해결.
2.1.2 템플릿 문자열
백틱(`)으로 감싸는 문자열. 문자열 안에 변수를 넣을 수 있다.
2.1.3 객체 리터럴

객체의 메서드에 함수를 연결할 때 콜론(:)과 function을 붙이지 않아도 된다.
sayNode: sayNode 처럼 속성명과 변수명이 동일한 경우에는 한 번만 써도 되게 변경.
객체의 속성명을 동적으로 생성할 수 있다.

2.1.4 화살표 함수
function 선언 대신 ⇒ 기호를 사용한다.
내부에 return문 밖에 없는 경우 return문을 줄일 수 있다.
매개 변수가 한 개면 매개변수를 소괄호로 묶어주지 않아도 된다.
this를 사용할 경우 상위 스코프의 this를 그대로 물려받을 수 있다.
2.1.5 구조분해 할당
객체와 배열로부터 속성이나 요소를 쉽게 꺼낼 수 있다.
특히 노드에서는 모듈 시스템을 사용하므로 자주 사용.
2.1.6 클래스
클래스 기반으로 동작하는 다른 언어들과 달리 여전히 프로토타입 기반으로 동작하지만 클래스처럼 보이게.
extends 를 이용하면서 상속받기 위한 코드가 간략해짐.
2.1.7 프로미스
API들이 콜백 대신 프로미스 기반으로 재구성되며, 콜백 지옥 현상을 극복함.
프로미스 객체를 생성하고, then이나 catch를 통해 결괏값을 받는다.
2.1.8 async, await
노드 7.6,  ES2017에 추가된 기능. 
then과 catch가 계속 반복되는 프로미스를 한 번 더 깔끔하게 줄일 수 있다.
// promise
function findAndSaveUser(Users) {
    Users.findOne({})
        .then((user) => {
            user.name = 'zero';
            return user.save();
        })
        .then((user) => {
            return Users.findOne({ gender: 'm' });
        })
        .then((user) => {
            // 생략
        })
        .catch(err => {
            console.error(err);
        });
}

// async await
const findAndSaveUser = async (Users) => {
    try {
        let user = await Users.findOne({});
        user.name = 'zero';
        user = await user.save(); // 이전 프로미스가 resolve될 때까지 기다린 뒤 실행한다.
        user = await Users.findOne({ gender: 'm' });
        // 생략
    } catch (err) {
        console.error(err);
    }
}

2.2 프런트엔드 자바스크립트
2.2.1 AJAX
비동기적 웹 서비스를 개발할 때 사용하는 기법.
페이지 이동 없이 서버에 요청을 보내고 응답을 받는 기술.
브라우저에서 기본적으로 XMLHttpRequest 객체를 제공하지만 서버에서는 사용할 수 없으므로 jQuery나 axios 같은 라이브러리를 이용한다. 
// promise
axios.get('https://www.zerocho.com/api/get')
    .then((result) => {
        console.log(result);
        console.log(result.data); // {}
    })
    .catch((err) => {
        console.error(err);
    });

// async, await
(async () => {
    try {
        const result = await axios.get('https://www.zerocho.com/api/get');
        console.log(result);
        console.log(result.data); // {}
    } catch (err) {
        console.error(err);
    };
})();

2.2.2 FormData
HTML form 태그의 데이터를 동적으로 제어할 수 있는 기능. 주로 AJAX와 함께 사용
// async, await
(async () => {
    try {
        const formData = new FormData();
        formData.append('name', 'zerocho');
        formData.append('birth', 1994);
        const result = await axios.post('https://www.zerocho.com/api/get', formData);
        console.log(result);
        console.log(result.data);
    } catch (err) {
        console.error(err);
    };
})();

2.2.3 encodeURIComponent, decodeURIComponent
주소에 한글이 들어가는 경우 사용. 한글 부분만 encodeURIComponent 메서드로 감싼다.
받는 쪽에서는 decodeURIComponent를 사용한다.
2.2.4 데이터 속성과 dataset
데이터 속성 : HTML과 관련된 데이터를 저장하는 공식적인 방법. 
장점 : 자바스크립트로 쉽게 접근할 수 있다.
반대로 dataset에 데이터를 넣어도 HTML태그에 반영된다.

2th/reading_note_4.html.body:
4장 http 모듈로 서버 만들기 🚀
4.1 요청과 응답 이해하기
서버는 클라이언트가 있기에 동작한다. 클라이언트로부터 요청(request)을 받으면, 읽고 처리한 뒤 응답(response)을 보낸다.
요청이 왔을 때 어떤 작업을 수행할 지 이벤트 리스너를 미리 등록해야 한다.

NOTE: localhost와 포트란?
localhost는 현재 컴퓨터의 내부 주소를 가리킨다. IP로는 127.0.0.1.
포트는 서버 내에서 프로세스를 구분하는 번호다. 
유명한 포트 번호 : 21(FTP), 80(HTTP), 443(HTTPS), 3306(MYSQL)
리눅스와 맥에서는 1024번 이하의 포트에 연결할 때 관리자 권한이 필요하므로 명령어 앞에 sudo를 붙여야 한다.

기본 사용 방법
const http = require('http');

// 방법 1 (listen 메서드에 콜백 함수)
http.createServer((req, res) => { // param: 요청에 대한 콜백 함수
    res.writeHead(200, { 'Content-Type': 'text/html; charset=uft-8' });
  // writeHead: 응답에 대한 정보(헤더)를 기록하는 메서드

    res.write('Hello Node!');
  // write: 클라이언트로 보낼 데이터(body)를 기록하는 메서드

    res.end('Hello Server!')
  // end: 응답을 종료하는 메서드
})
    .listen(8080, () => {
  // listen: 클라이언트에 공개한 포트 번호 및 연결 완료 후 실행될 콜백 함수
        console.log('8080번 포트에서 서버 대기 중입니다!');
    })

// 방법 2 (listening 이벤트 리스너)
const server = http.createServer((req, res) => {
    res.writeHead(200, { 'Content-Type': 'text/html; charset=uft-8' });
    res.write('Hello Node!');
    res.end('Hello Server!')
})
server.listen(8080);
server.on('listening', () => {
    console.log('8080번 포트에서 서버 대기 중입니다!');
})
server.on('error', (err) => {
    console.error(err);
})

HTML 파일을 fs 모듈로 읽어오기
const http = require('http');
const fs = require('fs').promises;

http.createServer(async (req, res) => {
    try {
        const data = await fs.readFile('./server2.html');
    // fs로 HTML 파일을 읽고, 버퍼를 클라이언트에 보낸다.
        res.writeHead(200, { 'Content-Type': 'text/html; charset=uft-8' });
        res.end(data);
    } catch (err) {
        console.log(err);
        res.writeHead(500, { 'Content-Type': 'plain; charset=uft-8' });
        res.end(err.message);
    } 
})
.listen(8081, () => {
    console.log('8081번 포트에서 서버 대기 중입니다!');
})


NOTE: HTTP 상태 코드
브라우저는 서버에서 보내주는 상태 코드를 보고 요청이 성공했는지 실패했는지 판단한다.

2XX : 성공을 알리는 상태 코드. 200(성공), 201(작성됨)
3XX : 리다이렉션(다른 페이지로 이동)을 알리는 상태 코드. 301(영구 이동), 302(임시 이동), 304(수정되지 않음)
4XX : 요청 오류. 400(잘못된 요청), 401(권한 없음), 403(금지됨), 404(찾을 수 없음)
5XX : 서버 오류. writeHead로 직접 보내는 경우는 거의 없고, 예기치 못한 에러 발생 시 서버가 알아서 보낸다. 500(내부 서버 오류), 502(불량 게이트웨이), 503(서비스를 사용할 수 없음)


4.2 REST와 라우팅 사용하기
서버에 요청을 보낼 때 주소를 통해 요청의 내용을 표현한다. 그러므로 서버가 이해하기 쉬운 주소를 사용하는 것이 좋다 = REST
REST란
REpresentational State Transfer의 줄임말.
서버의 자원을 정의하고 자원에 대한 주소를 지정하는 방법 또는 약속.
주소의 의미를 명확히 전달하기 위해 명사로 구성된다. (/user, /post)
HTTP 요청 메서드
주소 외에 HTTP 요청 메서드를 사용.



HTTP 요청 메서드 종류
설명




GET
서버 자원을 가져오고자 할 때 사용.요청의 본문에 데이터를 넣지 않는다.데이터를 서버로 보내야 한다면 쿼리스트링을 사용.


POST
서버에 자원을 새로 등록하고자 할 때 사용요청의 본문에 새로 등록한 데이터를 넣어 보냄.


PUT
서버의 자원을 요청에 들어 있는 자원으로 치환할 때 사용.요청의 본문에 치환할 데이터를 넣어 보냄.


PATCH
서버 자원의 일부만 수정하고자 할 때 사용요청의 본문에 일부 수정할 데이터를 넣어 보냄.


DELETE
서버의 자원을 삭제하고자 할 때 사용.요청의 본문에 데이터를 넣지 않는다.


OPTIONS
요청을 하기 전에 통신 옵션을 설명하기 위해 사용.



REST의 장점

주소와 메서드만 보고 요청의 내용을 알아볼 수 있다.
GET의 경우 브라우저에서 캐싱이 가능하여 성능 향상도 기대.
클라이언트가 누구든 상관 없이 같은 방식으로 서버와 소통할 수 있다. 
서버와 클라이언트가 분리되어 있으므로 추후 서버를 확장할 때 클라이언트에 구애받지 않는다.

RESTful한 웹 서버 만들기

RESTful : REST를 따르는 서버를 일컫는 말

const http = require('http');
const fs = require('fs').promises;

const users = {}; // 데이터 저장용

http.createServer(async (req, res) => {
    try {
        console.log(req.method, req.url);
        if (req.method === 'GET') {
            if (req.url === '/') {
                const data = await fs.readFile('./restFront.html');
                res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
                return res.end(data);
            } else if (req.url === '/about') {
                const data = await fs.readFile('./about.html');
                res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
                return res.end(data);
            } else if (req.url === '/users') {
                res.writeHead(200, { 'Content-Type': 'text/plain; charset=utf-8' });
                return res.end(JSON.stringify(users));
            }
            // 주소가 /도 /about도 /users도 아니면
            try {
                const data = await fs.readFile(`.${req.url}`);
        return res.end(data);
            } catch (err) {
                // 주소에 해당하는 라우트를 못 찾았다는 404 Not Found error 발생
            }
        } else if (req.method === 'POST') {
            if (req.url === '/user') {
                let body = '';
                // 요청의 body를 stream형식으로 받음
                req.on('data', (data) => {
                    body += data;
                });
                // 요청의 body를 받은 후 실행됨.
                return req.on('end', () => {
                    console.log('POST 본문(Body):', body);
                    const { name } = JSON.parse(body);
                    const id = Date.now();
                    users[id] = name;
                    res.writeHead(201);
                    res.end('등록 성공');
                })
            }
        } else if (req.method === 'PUT') {
            if (req.url.startsWith('/user/')) {
                const key = req.url.split('/')[2];
                let body = '';
                req.on('data', (data) => {
                    body += data;
                });
                return req.on('end', () => {
                    console.log('PUT 본문(Body):', body);
                    users[key] = JSON.parse(body).name;
                    return res.end(JSON.stringify(users));
                })
            }
        } else if (req.method === 'DELETE') {
            if (req.url.startsWith('/user/')) {
                const key = req.url.split('/')[2];
                delete users[key];
                return res.end(JSON.stringify(users));
            }
        }
        res.writeHead(404);
        return res.end('NOT FOUND');
    } catch (err) {
        console.error(err);
    res.writeHead(500, { 'Content-Type': 'text/plain; charset=utf-8' });
    res.end(err.message);
    }
})
    .listen(8082, () => {
        console.log('8082번 포트에서 서버 대기 중입니다');
    });


NOTE: res.end 앞에 return을 붙이는 이유
노드도 일반적으로 자바스크립트 문법을 따르므로 return을 붙이지 않는 한 함수가 종료되지 않는다.
return을 붙이지 않아서 res.end 같은 메서드가 여러 번 실행된다면 에러 발생.

Network 탭으로 확인하기

Name: 요청 주소
Method: 요청 메서드
Status: HTTP 응답 코드
Protocol: 통신 프로토콜
Type: 요청의 종류. xhr 는 AJAX 요청



NOTE: 헤더와 본문

General: 공통된 헤더
Response Headers: 응답의 헤더
Request Headers: 요청의 헤더
Request Payload: 응답의 본문



4.3 쿠키와 세션 이해하기
로그인을 구현하려면 쿠키와 세션을 이해해야 한다.
서버로부터 쿠키가 오면 웹 브라우저는 쿠키를 저장해두었다가 다음에 요청할 때마다 쿠키를 동봉해서 보낸다. 서버는 요청에 들어 있는 쿠키를 읽어서 사용자가 누구인지 파악한다.
쿠키 : 이용자 정보를 담고 있는 키-값의 쌍. 유효기간이 있다. 요청의 헤더(Cookie)에 담겨 전송되고, 브라우저는 응답의 헤더(Set-Cookie)에 따라 쿠키를 전송한다.
쿠키 브라우저에 전송하기
const http = require('http');

http.createServer((req, res) => {
    console.log(req.url, req.headers.cookie);
    res.writeHead(200, { 'Set-Cookie' : 'mycookie=test' });
    res.end('Hello Cookie');
})
    .listen(8083, () => {
        console.log('8083번 포트에서 서버 대기 중입니다!');
    })

쿠키로 유저 식별하기
const http = require('http');
const fs = require('fs').promises;
const url = require('url');
const qs = require('querystring');

// 쿠키를 쉽게 사용하기 위해 객체 형식으로 변환
const parseCookies = (cookie = '') =>
  cookie
    .split(';')
    .map(v => v.split('='))
    .reduce((acc, [k, v]) => {
      acc[k.trim()] = decodeURIComponent(v);
      return acc;
    }, {});

http.createServer(async (req, res) => {
  const cookies = parseCookies(req.headers.cookie);
  // 주소가 /login으로 시작하는 경우
  if (req.url.startsWith('/login')) {
    const { query } = url.parse(req.url);
    const { name } = qs.parse(query);
    const expires = new Date();
    // 쿠키 유효 시간을 현재시간 + 5분으로 설정
    expires.setMinutes(expires.getMinutes() + 5);
    res.writeHead(302, {
      Location: '/',
      'Set-Cookie': `name=${encodeURIComponent(name)}; Expires=${expires.toGMTString()}; HttpOnly; Path=/`,
    });
    res.end();
  // name이라는 쿠키가 있는 경우
  } else if (cookies.name) {
    res.writeHead(200, { 'Content-Type': 'text/plain; charset=utf-8' });
    res.end(`${cookies.name}님 안녕하세요`);
  } else {
    try {
      const data = await fs.readFile('./cookie2.html');
      res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
      res.end(data);
    } catch (err) {
      res.writeHead(500, { 'Content-Type': 'text/plain; charset=utf-8' });
      res.end(err.message);
    }
  }
})
  .listen(8084, () => {
    console.log('8084번 포트에서 서버 대기 중입니다!');
  });

Set-Cookie 옵션



옵션명
설명




쿠키명=쿠키값
기본적인 쿠키의 값. mycookie=test


Expires=날짜
만료 기한. 기본값은 클라이언트가 종료될 때까지


Max-age=초
Expires 와 달리 초를 입력할 수 있다. Expires 보다 우선.


Domain=도메인명
쿠키가 전송될 도메인을 특정할 수 있다. 기본값은 현재 도메인.


Path=URL
쿠키가 전송될 URL을 특정할 수 있다. 기본값은 '/'이며 이 경우 모든 URL에서 쿠키를 전송할 수 있다.


Secure
HTTPS일 때만 쿠키 전송


HttpOnly
설정 시 자바스크립트에서 쿠키에 접근할 수 없음. 쿠키 조작 방지용.



세션
서버에 사용자 정보를 저장하고 클라이언트와는 세션 아이디로만 소통하는 방식.
세션 아이디는 꼭 쿠키를 사용하지 않아도 되지만 제일 간단하여 많이 사용됨.
세션쿠키 : 세션을 위해 사용하는 쿠키
세션을 저장하기 위해 레디스(Redis)나 맴캐시드(Memcached)같은 데이터베이스에 넣어둔다.
세션 쿠키와 일반 쿠키 비교
// Cookie
res.writeHead(302, {
      Location: '/',
      'Set-Cookie': `name=${encodeURIComponent(name)}; Expires=${expires.toGMTString()}; HttpOnly; Path=/`,
    });

// Session Cookie
const session = {};
...
const uniqueInt = Date.now();
    session[uniqueInt] = {
      name,
      expires,
    };
...
res.writeHead(302, {
      Location: '/',
      'Set-Cookie': `session=${uniqueInt}; Expires=${expires.toGMTString()}; HttpOnly; Path=/`,
    });

4.4 https와 http2
https 모듈
웹 서버에 SSL 암호화를 추가하는 모듈. 주로 로그인이나 결제가 필요한 창에서 적용한다.
인증 기관에서 인증서를 구입해야 하며, Let's Encrypt같은 기관에서 무료로 발급해주기도 한다.
https 모듈 코드
const https = require('https');
const fs = require('fs');

// createServer가 인증서 옵션 객체를 추가 인수로 받는다.
https.createServer({
  cert: fs.readFileSync('도메인 인증서 경로'),
  key: fs.readFileSync('도메인 비밀키 경로'),
  ca: [
    fs.readFileSync('상위 인증서 경로'),
    fs.readFileSync('상위 인증서 경로'),
  ],
}, (req, res) => {
  res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
  res.write('Hello Node!');
  res.end('Hello Server!');
})

// https이므로 443포트를 사용
  .listen(443, () => {
    console.log('443번 포트에서 서버 대기 중입니다!');
  });

http2 모듈
SSL 암호화와 더불어 최신 HTTP 프로토콜인 http/2를 사용할 수 있다.
http/2를 사용하면 http/1.1보다 효율적으로 요청을 보내므로 웹의 속도를 개선할 수 있다.
http2 모듈 코드
const http2 = require('http2');
const fs = require('fs');

http2.createSecureServer({
  cert: fs.readFileSync('도메인 인증서 경로'),
  key: fs.readFileSync('도메인 비밀키 경로'),
  ca: [
    fs.readFileSync('상위 인증서 경로'),
    fs.readFileSync('상위 인증서 경로'),
  ],
}, (req, res) => {
  res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
  res.write('Hello Node!');
  res.end('Hello Server!');
})
  .listen(443, () => {
    console.log('443번 포트에서 서버 대기 중입니다!');
  });

4.5 cluster
cluster 모듈
싱글 프로세스로 동작하는 노드가 CPU 코어를 모두 사용할 수 있게 하는 모듈.
요청이 많이 들어왔을 때 병렬로 실행된 서버의 개수만큼 요청이 분산되게 할 수 있으므로 서버의 부담을 줄일 수 있다.
cluster 모듈 코드
const cluster = require('cluster');
const http = require('http');
const numCPUs = require('os').cpus().length;

if (cluster.isMaster) {
    console.log(`마스터 프로세스 아이디: ${process.pid}`);
    // CPU 개수만큼 워커를 생산
    for (let i = 0; i  {
        console.log(`${worker.process.pid}번 워커가 종료되었습니다.`);
        console.log('code', code, 'signal', signal);
    })
} else {
    // 워커들이 포트에서 대기
  http.createServer((req, res) => {
    res.writeHead(200, { 'Content-Type': 'text/html; charset=utf-8' });
    res.write('Hello Node!');
    res.end('Hello Cluster!');
    setTimeout(() => { // 워커 존재를 확인하기 위해 1초마다 강제 종료
      process.exit(1);
    }, 1000);
  }).listen(8086);

  console.log(`${process.pid}번 워커 실행`);
}

클러스터링
클러스터링을 적용하면 예기치 못한 에러로 서버가 종료되는 현상을 방지할 수 있다.
직접 cluster 모듈로 클러스터링을 구현할 수 있지만 실무에서는 pm2등의 모듈을 사용한다.

2th/reading_note_6.html.body:
6장 익스프레스 웹 서버 만들기 🚀

익스프레스란?
node로 서버를 제작하는 과정에서의 불편함을 해소하기 위해 만들어진 웹 서버 프레임워크.
비슷한 프레임워크로는 koa, hapi 등이 있다.

6.1 익스프레스 프로젝트 시작하기

package.json 생성 후 정보 작성
npm i express, npm i -D nodemon 으로. 필요한 패키지 설치
app.js 에 다음과 같이 작성 후 npm start 로 실행.

package.json
{
  "name": "learn-express",
  "version": "1.0.0",
  "description": "익스프레스를 배우자",
  "main": "app.js",
  "dependencies": {
    "express": "^4.17.1"
  },
  "devDependencies": {
    "nodemon": "^2.0.6"
  },
  "scripts": {
    "start": "nodemon app", // app.js를 nodemon으로 실행. 변경이 생기면 자동으로 서버를 재시작한다.
    "test": "echo \"Error: no test specified\" && exit 1"
  },
  "author": "swimjiy",
  "license": "MIT"
}

app.js
const express = require('express');

const app = express();
app.set('port', process.env.PORT || 3000);
// app.set(키, 값)으로 데이터를 저장하고, app.get(키) 로 접근.

app.get('/', (req, res) => {
    res.send('Hello Express'); // == node의 res.write, res.end

  // sendFile에서 파일 경로를 지정하여 HTML 형태로 응답할 수 있다.
    res.sendFile(path.join(__dirname, './index.html'));
})
// app.get(주소, 라우터)로 주소에 대한 GET 요청이 올 때의 동작을 지정.

app.listen(app.get('port'), () => {
    console.log(app.get('port'), '번 포트에서 대기 중');
});

6.2 자주 사용하는 미들웨어
익스프레스의 핵심. 요청과 응답의 중간에 위치하여 미들웨어라고 부른다. (라우터, 에러 핸들러 등...)
app.use(미들웨어) 형태로 사용.
위에서부터 아래로 순서대로 실행되며, next라는 매개변수로 다음 미들웨어로 넘어갈 수 있다.
주소를 첫 번째 인수로 넣어주지 않으면 모든 요청에서 실행되고, 넣는다면 해당하는 요청에서만 실행된다.
기본 미들웨어 사용 방법
const express = require('express');
const path = require('path');

const app = express();
app.set('port', process.env.PORT || 3000);

app.use((req, res, next) => {
    console.log('모든 요청에 다 실행됩니다.');
    next(); // next를 호출해야 다음 미들웨어로 넘어갈 수 있다.
})

app.get('/', (req, res, next) => {
    console.log('GET / 요청에만 실행됩니다.');
    next();
}, (req, res) => {
    throw new Error('에러는 에러 처리 미들웨어로 갑니다.');
}) // app.get 라우터에 미들웨어가 두 개 연결됨. 

// 에러 처리 미들웨어. 네 개의 변수를 갖고 있음.
// 특별한 경우가 아니면 가장 아래에 위치하도록 한다.
app.use((err, req, res, next) => {
    console.log(err);
    res.status(500).send(err.message);
})

app.listen(app.get('port'), () => {
    console.log(app.get('port'), '번 포트에서 대기 중');
});

미들웨어가 실행되는 경우



코드
설명




app.use(미들웨어)
모든 요청에서 미들웨어 실행


app.use('/abc', 미들웨어)
abc로 시작하는 요청에서 미들웨어 실행


app.post('/abc', 미들웨어)
abc로 시작하는 POST 요청에서 미들웨어 실행



실무에 사용하는 미들웨어 알아보기
$ npm i morgan cookie-parser express-session dotenv

dotenv
보안 상의 편의를 위해 process.env 를 별도의 파일로 관리할 수 있게 하는 패키지. (미들웨어는 아님!)
.env  파일을 읽어서 process.env 로 키=값을 추가한다.
6.2.1 morgan
요청과 응답에 대한 정보를 콘솔에 기록한다.
사용 방법
app.use(morgan('dev'));
// dev 대신 combined(배포 환경에 추천), common, short, tiny 등을 넣을 수 있다.

console
# [HTTP 메서드][주소][HTTP 상태 코드][응답 속도] - [응답 바이트]
GET / 304 1.253 ms - 150

6.2.2 static
express에서 기본 제공.
정적인 파일들(css, js, images)을 제공하는 라우터 역할. 
fs.readFile 로 파일을 직접 읽어서 전송할 필요가 없어진다.
요청 경로에 해당하는 파일이 없으면 내부적으로 next 를 호출하며, 파일을 발견하면 다음 미들웨어는 실행되지 않는다.
사용 방법
app.use('요청 경로', express.static('실제 경로'));

// 실제 서버의 폴더 경로는 public이 있지만, 요청 주소에는 public이 없으므로 보안 유지.
app.use('/', express.static(path.join(__dirname, 'public')));


💡 그럼 파일을 발견해서 다음 미들웨어가 실행되지 않으면 그걸로 코드 끝...? => 네. 뒤에 거는 막힙니다. 6-2-6

6.2.3 body-parser
express에서 기본 제공. (v 4.16.0 ~)
요청의 본문에 있는 데이터를 해석해서 req.body 객체로 만들어주는 미들웨어.
보통 폼 데이터나 AJAX 요청의 데이터를 처리
멀티파트(이미지, 동영상, 파일) 데이터는 처리하지 못한다. (multer 모듈 사용)
사용 방법
app.use(express.json());
app.use(express.urlencoded({ extended: false }));

// Raw, Text 형식의 데이터를 해석할 경우 설치 후 아래와 같이 추가
const bodyParser = require('body-parser');
app.use(bodyParser.raw());
app.use(bodyParser.text());

요청 데이터 종류

JSON: JSON 형식의 데이터 전달 방식
URL-encoded: 주소 형식의 데이터 전달 방식.
extended 옵션: false 면 노드의 querystring 모듈을 사용하여 쿼리스트링을 해석하며 true 면 qs 모듈로 해석.
name=swimjiy&book=nodejs => req.body { name: 'swimjiy', book: 'nodejs' }



6.2.4 cookie-parser
요청에 동봉된 쿠키를 해석해 req.cookies 객체로 만드는 미들웨어.
name=swimjiy => req.cookie { name: 'swimjiy' }
사용 방법
app.use(cookieParser(비밀키));
// 서명된 쿠키가 있는 경우, 인수로 제공한 비밀키를 통해 해당 쿠키가 내 서버가 만든 쿠키임을 검증할 수 있다.
// 서명이 붙은 쿠키는 .sign이 뒤에 붙으며 req.signedCookies 객체에 저장

쿠키 생성/제거
res.cookie('name', 'swimjiy', {
  expires: new Date(Date.now() + 900000),
  httpOnly: true,
  secure: true,
  signd: true, // 쿠키 뒤에 서명이 붙는다. 서명을 위한 비밀 키는 process.env.COOKIE_SECRET
});

// 쿠키를 지우러면 키와 값 외에 옵션도 정확히 일치해야 한다. (expires, maxAge 제외)
res.clearCookie('name', 'swimjiy', {
  httpOnly: true,
  secure: true,
})

6.2.5 express-session
세션 관리용 미들웨어
로그인 등의 이유로 세션을 구현하거나 특정 사용자를 위한 데이터를 임시적으로 저장해둘 때 사용.
사용자별로 req.session 객체 안에 유지.
사용 방법
app.use(session({
    resave: false, // 요청이 올 때 세션에 수정 사항이 생기지 않더라도 세션을 다시 저장할 지 여부.
    saveUninitialized: false, // 세션에 저장할 내역이 없어도 처음부터 세션을 생성할지 여부.

  // 세션 관리 시 클라이언트에 쿠키를 보낸다. = 4.3절의 세션 쿠키!
    secret: process.env.COOKIE_SECRET, // 쿠키에 서명 추가
    cookie: { // 세션 쿠키 설정
        httpOnly: true, // 클라이언트에서 쿠키 확인 불가
        secure: false, // https 가 아닌 환경에도 사용 가능
    },
    name: 'session-cookie', // 세션 쿠키 이름

  // + store 옵션으로 레디스 등의 DB에 세션 저장. 현재는 메모리에 저장.
}))

세션 변경 및 삭제
req.session.name = 'swimjiy'; // 세션 등록
req.sessionID; // 세션 아이디 확인
req.session.destroy(); // 세션 모두 제거

6.2.6 미들웨어 특성 활용하기
미들웨어 tl;dr

미들웨어란 req, res, next 를 매개변수로 가지는 함수 (에러 처리 미들웨어만 예외)로서 app.use 나 app.get, app.post 등으로 장착.
특정 주소의 요청에만 실행되게 하려면 첫 번째 인수로 주소를 넣는다. app.use('/', (req, res, next) => {})
동시에 여러 개의 미들웨어 장착 가능. app.use(morgan('dev'), express.json(), ...)
다음 미들웨어로 넘어가려면 next 함수를 호출해야 한다. 아니면 res.send 나 res.sendFile 등의 메서드로 응답을 보내야 한다.
app.use((req, res, next) => {
 console.log('모든 요청에 다 실행됩니다.');
 next();
});




💡 갑자기 궁금한건데, 미들웨어가 req, res, next 를 매개변수로 갖고, morgan같은 건 저 매개변수랑 next()가 감춰져있다는 거잖아. 그럼 실제로는 어떻게 생긴거지???
콜백함수를 넘긴다.

next()
인수를 넣으면 특수한 동작을 한다.
next('route'); // 다음 라우터의 미들웨어로 바로 이동하고, 그 외의 인수를 넣으면 에러 처리 미들웨어로 이동.

next(err); // 인수가 에러 처리 미들웨어의 err 매개변수.
(err, req, res, next) => {}

미들웨어 간에 데이터 전달하기
요청이 끝날 때까지만 데이터를 유지한다.
app.use((req, res, next) => {
  req.data = '데이터 넣기';
  next();
}, (req, res, next) => {
  console.log(req.data); // 데이터 받기.
  next();
})


NOTE: app.set과의 차이
app.set은 익스프레스에서 전역적으로 사용되므로 사용자 개개인의 값을 넣기에는 부적절하다.
앱 전체의 설정을 공유할 때 사용.
req 객체는 요청을 보낸 사용자 개개인에게 귀속되므로 req 객체를 통해 개인의 데이터를 전달하는 것이 좋다.

미들웨어 안에 미들웨어 넣기
기존 미들웨어의 기능을 확장할 수 있다. (분기 처리 등)
// 기존 방식
app.use(morgan('dev'));

// 새 방식
app.use((req, res, next) => {
  morgan('dev')(req, res, next);
});

조건문에 따라 다른 미들웨어를 적용하는 코드
app.use((req, res, next) => {
  if (process.env.NODE_ENV === 'production') {
    morgan('combined')(req, res, next);
  } else {
    morgan('dev')(req, res, next);
  }
});


💡 이게...굳이 (req, res, next) 를 쓰지 않으면 안돌아가는건가?? 왜 저렇게 쓰는지 모르겠다.

6.2.7 multer
이미지, 동영상 등을 비롯한 여러 가지 파일들을 멀티파트 형식으로 업로드할 때 사용하는 미들웨어.

멀티파트: enctype=multipart/form-data 속성인 폼을 통해 업로드하는 데이터의 형식

const multer = require('multer');

const upload = multer({
  // 어디에(destination) 어떤 이름으로(filename) 저장할 지 설정
    storage: multer.diskStorage({
        destination(req, file, done) {
            done(null, 'uploads/'); // 첫 번째 인수에는 에러가 있다면 에러를 넣는다.
        },
        filename(req, file, done) {
            const ext = path.extname(file.originalname);
            done(null, path.basename(file.originalname, ext) + Date.now() + ext);
        }
    }),
    limits: { fileSize: 5 * 1024 * 1024 }, // 업로드에 대한 제한 상황 설정. 현재 5MB
});

위 설정을 실제로 활용하기 위해 서버에 반드시 uploads 폴더가 존재해야 한다.
const fs = require('fs');

try {
    fs.readFileSync('uploads');
} catch (error) {
    console.error('upload 폴더가 없어 uploads 폴더를 생성합니다.');
    fs.mkdirSync('uploads');
}

하나의 파일만 업로드 하는 경우




    업로드


/* js */
app.post('/upload', upload.single('image'), (req, res) => {
    console.log(req.file, req.body);
    res.send('ok');
});
// 업로드 성공 시 req.file 안에 객체 생성. req.body에는 파일이 아닌 데이터인 title이 들어 있다.

여러 파일을 업로드 하는 경우




    업로드


/* js */
app.post('/upload', upload.array('many'), (req, res) => {
    console.log(req.files, req.body);
    res.send('ok');
});
// 업로드 성공 시 req.files 안에 객체 배열 생성.

기타
/* input태그가 여러개일 떄 : field */
app.post('/upload', upload.fields([{ name: 'image1' }, { name: 'image2' }]), (req, res) => {
    console.log(req.files, req.body);
    res.send('ok');
});

/* 파일을 업로드하지 않고도 멀티파트 형식으로 업로드할 때 : none */
app.post('/upload', upload.none(), (req, res) => {
    console.log(req.body); // body만 존재
    res.send('ok');
});

6.3 Router 객체로 라우팅 분리하기
기본 사용 방법
/* routes/index.js */
const express = require('express');
const router = express.Router();

// GET / 라우터
router.get('/', (req, res) => {
    res.send('Hello, Express');
})

module.exports = router;


/* routes/user.js : 앞뒤 동일 */
...
// GET /user 라우터
router.get('/', (req, res) => {
    res.send('Hello, User');
})
...

/* app.js */
const indexRouter = require('./routes');
const userRouter = require('./routes/user');

app.use('/', indexRouter);
app.use('/user', userRouter);

next('route')
다음 라우터로 넘어가는 기능. 라우터에 연결된 나머지 미들웨어들을 건너뛰고 싶을 때.
router.get('/', (req, res, next) => {
    console.log('GET / 요청에만 실행됩니다.');
    next('route');
}, (req, res, next) => {
  console.log('실행되지 않습니다.')
    next();
});

router.get('/', (req, res) => {
    console.log('GET / 요청에만 실행됩니다.');
    res.send('Hello, Express!');
});


 💡그럼 나머지 실행 안되는 애들은 안쓰는건가?

라우터 특수 패턴: 라우트 매개변수
사용자 지정 패턴을 넣을 수 있고, req.params 에서 확인할 수 있다.
와일트카드 역할을 하므로 일반 라우터보다 뒤에 위치해야 한다.
router.get('/user/:id', (req, res) => {
    console.log(req.params, req.query);
});
// req.params.id 로 확인 가능.

6.4 req, res 객체 살펴보기
http 모듈의 req, res 객체를 확장한 것. 기존 메서드도 사용할 수 있고 추가적인 메서드도 있다.
req 객체



메서드
설명




