6.5 템플릿 엔진 사용하기
정적인 HTML을 대체하기 위해 탄생.
자바스크립트를 이용해서 HTML을 렌더링할 수 있다.
6.5.1 퍼그(제이드)
문법이 간단하여 코드의 양을 줄일 수 있다. 다만 HTML과 문법이 많이 다름.
