include 속성으로 MySQL의 JOIN 기능처럼 사용할 수 있다.
// 특정 사용자와 댓글까지 가져오는 로직
const user = await User.findOne({
  include: [{
    model: Comment,
    where: {
      id: 1,
    },
    attributes: ['id'],
