8.5 CRUD 작업하기
*자료형
몽고디비는 기본적으로 JS문법을 따르므로 자료형 또한 JS를 따른다. (Date() 등)
추가적으로 쓰는 자료형은 ObjectId, Binary Data, Timestamp 등이 있음.
8.5.1 Create(생성)
db.컬렉션명.save(다큐먼트) 로 생성.
db.users.save({ name: 'zero', age: 24, married: false, comment: '안녕하세요.', createdAt: new Date() });
