db.users.update({ name: 'zero' }, { $set: { comment: '안녕하세요 이 필드를 바꿔보겠습니다' } })

8.5.4 Delete(삭제)
db.users.remove([삭제할 다큐먼트 정보]) 로 삭제. 성공 시 삭제된 개수 반환.
