// ./models/index.js

const Sequelize = require('sequelize');
const env = process.env.NODE_ENV || 'development';
const config = require(__dirname + '/../config/config.json')[env];
const User = require('./user');
const Hashtag = require('./hashtag');
const Post = require('./post');

const db = {};
const sequelize = new Sequelize(config.database, config.username, config.password, config);

db.sequelize = sequelize;
db.User = User;
db.Hashtag = Hashtag;
db.Post = Post;

User.init(sequelize);
Post.init(sequelize);
Hashtag.init(sequelize);

// 각각의 모델들을 시퀄라이즈 객체에 연결.
User.associate(db);
Post.associate(db);
Hashtag.associate(db);

module.exports = db;

// ./models/user.js

const Sequelize = require('sequelize');

module.exports = class User extends Sequelize.Model {
    static init(sequelize) {
        return super.init({
            email: {
                type: Sequelize.STRING(40),
                allowNull: true,
                unique: true,
            },
            nick: {
                type: Sequelize.STRING(15),
                allowNull: false,
            },
            password: {
                type: Sequelize.STRING(100),
                allowNull: true,
            },
            provider: { // local: 로컬 로그인, kakao: 카카오 로그인
                type: Sequelize.STRING(10),
                allowNull: false,
                defaultValue: 'local',
            },
            snsId: { // sns 로그인 시 저장
                type: Sequelize.STRING(30),
                allowNull: true,
            },
        }, {
            sequelize,
            timestamps: true, // Set a createdAt and a updatedAt
            underscored: false,
            modelName: 'User',
            tableName: 'users',
            paranoid: true, // Set a deletedAt
            charset: 'uft8',
            collate: 'utf8_general_ci',
        });
    }

    // 각 모델 간의 관계를 associate 함수 안에 정의
    static associate(db) {
        db.User.hasMany(db.Post);
        // 같은 모델끼리 N:M 관계를 갖는다.
        // 사용자 한 명이 팔로워를 여러 명 가질 수도 있고, 한 사람이 여러 명을 팔로우할 수 있음.
        db.User.belongsToMany(db.User, {
            foreignKey: 'followingId', // foreignKey로 UserId 구별
            as: 'Followers', // foreignKey와 반대되는 모델을 가리킨다.
            through: 'Follow', // 생성할 모델명.
        });
        db.User.belongsToMany(db.User, {
            foreignKey: 'followerId',
            as: 'Followings',
            through: 'Follow',
        });
        // 관계 메서드: user.getFollowers, user.getFollowings
    }
}

