라우터 이름이 v1인 이유
한 번 버전이 정해진 후에는 라우터를 함부로 수정하면 안되기 때문.

// ./routes/v1.js

const express = require('express');
const jwt = require('jsonwebtoken');

const { verifyToken } = require('./middlewares');
const { Domain, User } = require('../models');

const router = express.Router();

// POST /v1/token : 토큰을 발급하는 라우터
router.post('/token', async (req, res) => {
  const { clientSecret } = req.body;
  try {
        // clientSecret 로 등록된 도메인인지 확인
    const domain = await Domain.findOne({
      where: { clientSecret },
      include: {
        model: User,
        attribute: ['nick', 'id'],
      },
    });
    if (!domain) {
      return res.status(401).json({
        code: 401,
        message: '등록되지 않은 도메인입니다. 먼저 도메인을 등록하세요',
      });
        }
        // 등록된 도메인이라면 jwt.sign 메서드로 토큰 발급
        // jwt.sign(토큰 내용, 토큰 비밀키, 토큰 설정)
    const token = jwt.sign({
      id: domain.User.id,
      nick: domain.User.nick,
    }, process.env.JWT_SECRET, {
      expiresIn: '1m', // 1분
      issuer: 'nodebird', // 발급자
    });
    return res.json({
      code: 200,
      message: '토큰이 발급되었습니다',
      token,
    });
  } catch (error) {
    console.error(error);
    return res.status(500).json({
      code: 500,
      message: '서버 에러',
    });
  }
});

// GET /v1/test : 사용자가 발급받은 토큰을 테스트해볼 수 있는 라우터
// verifyToken로 토큰을 검증하고, 성공하면 토큰의 내용을 응답으로 보냄.
router.get('/test', verifyToken, (req, res) => {
  res.json(req.decoded);
});

module.exports = router;

라우터 서버에 연결
