10.7 CORS 이해하기
CORS(Cross-Origin Resource Sharing): 요청을 보내는 클라이언트와 요청을 받는 서버의 도메인이 다를 경우 생기는 문제.
CORS 해결: 응답 헤더에 Access-Control-Allow-Origin 헤더를 넣어야 한다.
1) NodeBird API에 응답 헤더 조작하기
$ npm i cors

