// v2의 모든 라우터에 Access-Control-Allow-Origin 헤더가 자동 추가.
router.use(cors({
    credentials: true, // 다른 도메인 간에 쿠키 공유 가능. 
  // axios에서도 도메인이 다른 경우 withCredentials: true,
}));

...

